script: |
  super -f text -I q9670.spq | sort > q9670.out

inputs:
  - name: q9670.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - 36 NOT IN ( + + col0 / col2, col2 / + + 82 + - - ( 80 ) );
  - name: tab1

outputs:
  - name: q9670.out
    data: |
      51	14	96
      85	5	59
      91	47	68
